var parseEnv = (envs, envFile) => {
  const envVars = {};
  if (envs) {
    for (const env of envs) {
      if (env.includes("=")) {
        const [key, value] = env.split("=");
        if (key && value) {
          envVars[key] = value;
        }
      }
    }
  }
  if (envFile) {
    const envFileContent = fs4.readFileSync(envFile, "utf8");
    for (const line of envFileContent.split("\n")) {
      if (line.includes("=")) {
        const [key, value] = line.split("=");
        if (key && value) {
          envVars[key] = value;
        }
      }
    }
  }
  return Object.entries(envVars).map(([key, value]) => ({
    key,
    value
  }));
};
